import React from 'react'
import { TypeAnimation } from 'react-type-animation';

const Navbar = () => {
  return (
      <nav style={{backgroundImage: 'url("./images/yellow-bg.png")', 
backgroundSize: 'contain', backgroundRepeat: 'no-repeat', backgroundPositionX: 'right', height: "90vh"}}>

    <div className='flex justify-end px-20'>
    <TypeAnimation
      sequence={[
        // Same substring at the start will only be typed out once, initially
       'Welcome To Travelbound',
        1000,
      ]}
      wrapper="span"
      speed={50}
      style={{ fontFamily: 'Raleway', fontSize: '80px', display: 'inline-block', color: '#4ade80', fontStyle: 'bold' }}
      repeat={Infinity}
    />
      <div>
    <h3 className='flex justify-start font-bold text-[24px] text-start py-60'>Indulge in an immersive experience of nature, culture and history</h3>
    </div>
    <div className='header_button inline-flex justify-start'>
      <a href='#' className='inline-block px-5 bg-white'>Book Now</a>
      <a href='#' className='inline-block px-5 bg-white'>Contact</a>
      </div>
    <img src='/images/rajshahi streets.jpg' alt='rajshahi-streets' className='h-90 w-100 rounded-3xl my-20 mx-20 drop-shadow-2xl'></img>
      </div>
      </nav>
  )
}

export default Navbar
